import React from "react";
import { SafeAreaView, Text, View } from "react-native";

const HomeScreen = () => {
  return (
    <SafeAreaView style={{ backgroundColor: blue }}>
      <Text>Home</Text>
    </SafeAreaView>
  );
};

export default HomeScreen;
